import React from 'react';
import styled from 'styled-components';

export default function NotFoundPage() {
  return (
    <div>
      <Title>해당 페이지를 찾지 못했습니다</Title>
      <p>주소가 잘못되었거나 더 이상 제공되지 않는 페이지입니다.</p>
    </div>
  );
}

const Title = styled.h1`
  font-size: 3rem;
`;

